import {useNavigate} from "react-router-dom";


export function BasketItem({item}){
    const navigate = useNavigate()

    return <div className={'border-b-2'}>
        <div className={'cursor-pointer text-black/80'} onClick={()=>navigate(`/${item.categoryAPI}/${item.nameAPI}`)}>{item.name}</div>

    </div>
}
